import React from 'react'
import './Header.css'

class Header extends React.Component {
    render () {
        return (
            <div id="Header">
                <div>
                    Iam Logo
                </div>
                <div>
                    Iam plus
                </div>
            </div>
        )
    }
}

export default Header
